/**
 * Gets base64data images
 * @param {string} imgnb desired image
 * @returns {string} base64 uri of the image
 */
function base64imgselect(imgnb){
    let logo = "data:image/png;base64,";

    switch (imgnb) {
   
        case "logo":
            return logo;
            break;

        default:
            break;
    }
}
